import React from 'react';
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getallsafesitie } from '../../actions/actions';
import "./Panel.css"
import Card from '../../Components/Cards-Panel/Cards-Panel';


export default function Panel() {
    const dispatch = useDispatch();

    useEffect(() => {
        dispatch(getallsafesitie())
    }, [dispatch]);

    const lugaresSeguros = useSelector((state) => state.stateSitie)
    const user = useSelector((state) => state.user)
    console.log(lugaresSeguros)

    return (
        <>
            <div className="titular">
                <div className="titulo-panel">
                    Panel de control
                </div>
                <div className="linea-panel"></div>
            </div>
            {/* <div className="nombre">{user}</div> */}
            <div className="fondopanel">
                <div className="filtrados-panel">
                    <button>Pendientes</button>
                    <button>Denunciados</button>
                    <select name="" id="">
                        <option value="Argentina">Argentina</option>
                        <option value="Argentina">Bolivia</option>
                        <option value="Argentina">Brasil</option>
                        <option value="Argentina">Chile</option>
                        <option value="Argentina">Paraguay</option>
                        <option value="Argentina">Peru</option>
                        <option value="Argentina">Uruguay</option>
                        <option value="Argentina">Venezuela</option>

                    </select>
                </div>

                {lugaresSeguros.map(e => (
                    <Card name={e.name}
                        country={e.country}
                        street={e.street}
                        number={e.number}
                        email={e.email}
                        telephone={e.telephone}
                        town={e.town}
                        postcode={e.postcode} />
                ))
                }
            </div>
        </>


    )
}
